INSERT INTO `go_article` (`id`, `cateid`, `author`, `title`, `title_style`, `thumb`, `picarr`, `keywords`, `description`, `content`, `hit`, `order`, `posttime`, `url`) VALUES
(1, '2', '一元淘吧', '了解淘吧', '', '', 'a:0:{}', '', '', '<p>	</p><p><br/>一元淘吧是一种全新的互动购物体验方式，是时尚 、潮流的风向标，能满足个性、年轻消费者的购物需求，由巨野县睿派电子商务有限公司注入巨资打造的新型购物网。<br/><br/>一元淘吧以“快乐淘吧，惊喜无限”为宗旨，力求打造一个100%公平公正、100%正品保障、集娱乐与购物一体化的新型购物网站。<br/><br/>随着互联网的发展及网购消费模式的多样化，一元淘吧势必成为中国无线遥控模型网站中最具活力及模友最爱的购物网，必将迅速崛起，成为模界新时代的佼佼者！<br/><br/>一元淘吧是一种新型的网购模式，只需1元就有可能买到一件模型商品。一元淘吧网把一件商品平分成若干“等份”出售，每份1元，当一件商品所有“等份”售出后计算出一名幸运者，该幸运者即可获得此商品。<br/>规则：<br/><br/>1、每件商品参考市场价平分成相应“等份”，每份1元，1份对应1个1元淘码。<br/><br/>2、同一件商品可以购买多次或一次购买多份。<br/><br/>3、当一件商品所有“等份”全部售出后计算出“幸运1元淘码”，拥有“幸运1元淘码”者即可获得此商品。<br/><br/>4、幸运1元淘码计算方式：<br/><br/>1）取该商品最后购买时间前网站所有商品100条购买时间记录（限时揭晓商品取截止时间前网站所有商品100条购买时间记录）。<br/><br/>2）时间按时、分、秒、毫秒依次排列组成一组数值。<br/><br/>3）将这100组数值之和除以商品总需参与人次后取余数，余数加上10,000,001即为“幸运1元淘码”。<br/>流程：<br/><br/>1、挑选商品<br/><br/>分类浏览或直接搜索商品，点击“立即1元淘”。<br/><br/>2、支付1元<br/><br/>通过在线支付平台，支付1元即购买1人次，获得1个“1元淘码”。同一件商品可购买多次或一次购买多份，购买的“1元淘码”越多，获得商品的几率越大。<br/><br/>3、揭晓获得者<br/><br/>当一件商品达到总参与人次，计算出1名商品获得者，一元淘吧网会通过手机短信或邮件通知您领取商品。<br/>注：<br/><br/>1）商品揭晓后您可登录&quot;我的一元淘吧&quot;查询详情，未获得商品的用户不会收到短信或邮件通知；<br/><br/> &nbsp;2）商品揭晓后，请及时登录&quot;我的1元淘&quot;完善个人资料，以便我们能够准确无误地为您配送商品。<br/> &nbsp;<br/>3）所有已揭晓商品均不给予退款<br/><br/>4、晒单分享<br/><br/> &nbsp;晒出您收到的商品实物图片甚至您的靓照，说出您的1元淘心得，让大家一起分享您的快乐。<br/> &nbsp;<br/>在您收到商品后，您只需登录网站完成晒单，并通过审核，即可获得400-1500淘豆奖励。在您成功晒单后，您的晒单会出现在网站&quot;晒单分享&quot;区，与大家分享喜悦。</p>', 50, 1, 1375862513, NULL),
(3, '2', '一元淘吧', '服务协议', '', '', 'a:0:{}', '', '', '<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">&nbsp;&nbsp;&nbsp; 欢迎您访问并使用充满互动乐趣的模型购物网站一元淘吧，作为为用户提供全新、有趣购物模式的互联网公司，一元淘吧通过在线网站为您提供各项相关服务。当使用一元淘吧的各项具体服务时，您和一元淘吧都将受到本服务协议所产生的制约，一元淘吧会不断推出新的服务，因此所有服务都将受此服务条款的制约。请您在注册前务必认真阅读此服务协议的内容并确认，如有任何疑问，应向一元淘吧咨询。一旦您确认本服务协议后，本服务协议即在用户和一元淘吧之间产生法律效力。您在注册过程中点击“同意以下条款提交注册信息”按钮即表示您完全接受本协议中的全部条款。随后按照页面给予的提示完成全部的注册步骤。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">&nbsp;&nbsp;&nbsp;一元淘吧将可能不定期的修改本服务协议的有关条款，并保留在必要时对此协议中的所有条款进行随时修改的权利。一旦协议内容有所修改，一元淘吧将会在网站重要页面或社区的醒目位置第一时间给予通知。如果您继续使用一元淘吧的服务，则视为您受协议的改动内容。如果不同意本站对协议内容所做的修改，一元淘吧会及时取消您的服务使用权限。本站保留随时修改或中断服务而不需告知用户的权利。本站行使修改或中断服务的权利，不需对用户或第三方负责。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">一、用户注册</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、用户注册是指用户登录一元淘吧，按要求填写相关信息并确认同意本服务协议的过程。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、一元淘吧用户必须是具有完全民事行为能力的自然人，或者是具有合法经营资格的实体组织。无民事行为能力人、限制民事行为能力人以及无经营或特定经营资格的组织不得注册为一元淘吧用户或超过其民事权利或行为能力范围与一元淘吧进行交易，如与一元淘吧进行交易的，则服务协议自始无效，一元淘吧有权立即停止与该用户的交易、注销该用户账户，并有权要求其承担相应法律责任。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">二、用户的帐号，密码和安全性</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">用户一旦注册成功，成为本站的合法用户。用户将对用户名和密码安全负全部责任。此外，每个用户都要对以其用户名进行的所有活动和事件负全责。用户若发现任何非法使用用户帐号或存在安全漏洞的情况，请立即通告本站。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">三、一元淘吧原则</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、释义</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1元淘码：指一元淘吧网用户成功参与1元淘之后获得的随机分配编码。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">幸运1元淘码：指某件商品所有编码售出后，一元淘吧网根据规则计算出的一个编码，持有该编码的用户即可获得该商品。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、一元淘吧网承诺遵循以下的原则运营网站，确保所有用户在一元淘吧网中享受同等的权利与义务。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">平等原则：用户和一元淘吧在交易过程中具有同等的法律地位。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">自由原则：用户享有自愿向一元淘吧参与购买商品的权利，任何人不得非法干预。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">公平原则：用户和一元淘吧行使权利、履行义务应当遵循公平原则。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">诚实信用原则：用户和一元淘吧行使权利、履行义务应当遵循诚实信用原则。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">履行义务原则：用户向一元淘吧参与商品分享购买时，用户和一元淘吧皆有有义务根据本服务协议的约定完成该等交易（法律或本协议禁止的交易除外）</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">3、用户知悉，除本协议另有约定外，用户无论是否获得商品，参与1元淘的资金均用于帮助他人，不能退回；用户完全了解参与一元淘吧存在的风险，一元淘吧无法保证用户参与1元淘一定会获得商品。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">四、用户的权利和义务</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、用户有权拥有其在一元淘吧的用户名及密码，并用该用户名和密码登录一元淘吧参与商品购买。用户不得以任何形式转让或授权他人使用自己的一元淘吧用户名。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、用户有权根据本协议的规定以及一元淘吧网站上发布的相关规则在一元淘吧上查询商品信息、发表使用体验、参与商品讨论、邀请关注好友、上传商品图片、参加一元淘吧的有关活动，以及享受一元淘吧提供的其它信息服务</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">3、用户有义务在注册时提供自己的真实资料，并保证诸如电子邮件地址、联系电话、联系地址、邮政编码等内容的有效性及真实性，保证一元淘吧可以通过上述联系方式与用户本人进行联系。同时，用户也有义务在相关资料发生变更时及时更新有关注册资料。用户保证不以他人资料在一元淘吧进行注册和参与商品分享购买。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">4、用户应当保证在一元淘吧参与商品分享购买时遵守诚实信用原则，不扰乱网上交易的正常秩序。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">5、用户在成为一元淘吧的会员后，可按一元淘吧的福分规则享受福分获得。累积福分可用于福分商城中的相应福分商品兑换。福分规则连同与该规则相关的条款和条件，构成用户与一元淘吧之间的完整协议。接受本协议，即表明接受福分规则中的条款和条件。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">6、用户享有言论自由权利；并拥有适度修改、删除自己发表的文章的权利用户不得在一元淘吧发表包含以下内容的言论：</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1) 反对宪法所确定的基本原则，煽动、抗拒、破坏宪法和法律、行政法规实施的；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 