n style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">8) 公然侮辱他人或者捏造事实诽谤他人的，或者进行其他恶意攻击的；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">9) 损害国家机关信誉的；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">10) 其他违反宪法和法律行政法规的。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">7、用户在发表使用体验、讨论图片等，除遵守本条款外，还应遵守该讨论区的相关规定。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">8、未经一元淘吧同意，禁止用户在网站发布任何形式的广告。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">五、一元淘吧的权利和义务</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、一元淘吧有义务在现有技术上维护整个网上交易平台的正常运行，并努力提升和改进技术，使用户网上交易活动得以顺利进行；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、对用户在注册和使用一元淘吧网上交易平台中所遇到的与交易或注册有关的问题及反映的情况，一元淘吧应及时作出回复；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">3、对于用户在一元淘吧网站上作出下列行为的，一元淘吧有权作出删除相关信息、终止提供服务等处理，而无须征得用户的同意：</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1) 一元淘吧有权对用户的注册信息及购买行为进行查阅，发现注册信息或购买行为中存在任何问题的，有权向用户发出询问及要求改正的通知或者作出删除等处理；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2) 用户违反本协议规定或有违反法律法规和地方规章的行为的，一元淘吧有权停止传输并删除其信息，禁止用户发言，注销用户账户并按照相关法律规定向相关主管部门进行披露。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">3) 对于用户在一元淘吧进行的下列行为，一元淘吧有权对用户采取删除其信息、禁止用户发言、注销用户账户等限制性措施：包括发布或以