127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">六、配送及费用</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">一元淘吧将会把产品送到您所指定的送货地址。全国免费配送（港澳台地区除外）。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">请清楚准确地填写您的真实姓名、送货地址及联系方式。因如下情况造成配送延迟或无法配送等，本站将不承担责任：</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、客户提供错误信息和不详细的地址；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、货物送达无人签收，由此造成的重复配送所产生的费用及相关的后果。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">3、不可抗力，例如：自然灾害、交通戒严、突发战争等。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">七、商品缺货规则</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">由于市场变化及各种以合理商业努力难以控制的因素的影响，一元淘吧网无法承诺用户所获得的商品都会有货；用户获得的商品或服务如果发生缺货，协议双方均无权取消该交易，一元淘吧网将通过有效方式通知用户进行换货，用户可选择换购本商城同等价位的商品（一件或多件），或选择补差价换购高价位商品。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">一元淘吧网可对即将上市的商品或服务进行预售登记，一元淘吧网会在商品或者服务正式上市之后尽最大努力在最快时间内给商品获得者安排发货，预售登记并不做交易处理，不构成要约。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">八、责任限制</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、用户理解并同意，在使用一元淘吧网服务的过程中，可能会遇到不可抗力等风险因素使一元淘吧网服务发生中断。不可抗力是指不能预见、不能克服并不能避免且对一方或双方造成重大影响的客观事件，包括但不限于自然灾害如洪水、地震、瘟疫流行和风暴等以及社会事件如战争、动乱、政府行为等。出现上述情况时，一元淘吧网将努力在第一时间与相关单位配合，及时进行修复，但是由此给用户造成的损失，一元淘吧网将在法律允许的范围内免责。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、用户理解并同意，一元淘吧网不能随时预见和防范法律、技术以及其他不可控的风险，对以下情形之一导致的服务中断或受阻，一元淘吧网不承担责任：</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">（1）大规模病毒、木马或其他恶意程序、黑客攻击的破坏；</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">（2）用户或一元淘吧网的电脑软件、系统、硬件和通信线路出现故障；</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">（3）用户操作不当；</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">（4）用户通过非一元淘吧网授权的方式使用服务；</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">（5）政府管制等原因可能导致的服务中断、数据丢失以及其他的损失和风险。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软