 color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、经用户同意，向第三方披露；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、如用户是合资格的知识产权投诉人并已提起投诉，应被投诉人要求，向被投诉人披露，以便双方处理可能的权利纠纷；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">3、根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">4、如果用户出现违反中国有关法律或者网站政策的情况，需要向第三方披露；</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">5、为提供你所要求的产品和服务，而必须和第三方分享用户的个人信息；</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">6、其它本站根据法律或者网站政策认为合适的披露。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">十一、法律管辖和适用</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">1、本协议的订立、执行和解释及争议的解决均应适用中国法律。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">2、如发生本站服务条款与中国法律相抵触时，则这些条款将完全按法律规定重新解释，而其它合法条款则依旧保持对用户产生法律效力和影响。</span></p><p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">3、本协议的规定是可分割的，如本协议任何规定被裁定为无效或不可执行，该规定可被删除而其余条款应予以执行。</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: 微软雅黑; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; color: rgb(127, 127, 127); font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">4、如双方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向本站所在地的人民法院提起诉讼。</span></p>', 98, 0, 1375862644, NULL),
(4, '3', '一元淘吧', '保障体系', '', '', 'a:0:{}', '', '', '<p>	</p><h4 class="mat0" style="margin: 0px; padding: 0px; font-family: 微软雅黑, Arial; font-size: 14px; color: rgb(102, 102, 102); line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">100%正品保证</h4>\n<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">一元淘吧精心挑选优质服务品牌商家，保障全场商品100%品牌正品。</p>\n<h4 style="margin: 30px 0px 0px; padding: 0px; font-family: 微软雅黑, Arial; font-size: 14px; color: rgb(102, 102, 102); line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">100%公平公正</h4><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">整个过程是完全透明，您可以随时查看每件商品参与人数，参与次数，参与名单及获得者信息等记录。</p><h4 style="margin: 30px 0px 0px; padding: 0px; font-family: 微软雅黑, Arial; font-size: 14px; color: rgb(102, 102, 102); line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">全国免费快递</h4>\n<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">一元淘吧承诺全场所有商品全国免费快递。（港澳台地区除外）</p>\n', 77, 0, 1375862690, NULL);
INSERT INTO `go_article` (`id`, `cateid`, `author`, `title`, `title_style`, `thumb`, `picarr`, `keywords`, `description`, `content`, `hit`, `order`, `posttime`, `url`) VALUES
(5, '3', '一元淘吧', '正品保障', '', '', 'a:0:{}', '', '', '<p>	</p>\n<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">一元淘吧严格控制供应渠道，全部商品均从品牌官方以及品牌经销商直接采购供货，并取得品牌官方网络销售授权书，如果您认为1元淘的商品是假货，并能提供国家相关质检机构的证明文件，经确认后，在返还商品金额的同时并提供假一赔十服务保障。为了保障您的利益，对一元淘吧的商品，做如下说明：</span></p>\n<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">1、一元淘吧对所有商品均保证正品行货，正规渠道发货，所有商品都可以享受生产厂家的全国联保服务，按照国家三包政策，针对所售商品履行保修、换货和退货的义务。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">2、出现国家三包所规定的功能性故障时，经由生产厂家指定或特约售后服务中心检测确认故障属实，您可以选择换货或者维修；超过15日且在保修期内，您只能在保修期内享受免费维修服务。为了不耽误您使用，缩短故障商品的维修时间，我们建议您直接联系生产厂家售后服务中心进行处理。您也可以直接在商品的保修卡中查找该商品对应的全国各地生产厂家售后服务中心联系处理。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">3、一元淘吧真诚提醒广大幸运者在您收到商品的时候，请尽量亲自签收并当面拆箱验货，如果有问题(运输途中的损坏)请不要签收!与快递员交涉，拒签，退回!</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">4、在收到商品后发现有质量问题，请您不要私自处理，妥善保留好原包装，第一时间联系一元淘吧客服人员，由一元淘吧同发货商城协商在48小时内解决。如有破损或丢失，我们将无法为您办理退货。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">如对协商处理结果存在异议，请您自行到当地生产厂家售后服务中心进行检测，并开据正规检测报告（对于有些生产厂家售后服务中心无法提供检测报告的，需提供维修检验单据），如果检测报告确认属于质量问题，然后将检测报告、问题商品及完整包装附件，一并返还发货商城办理换货手续，产生的相关费用由一元淘吧追究相关责任方承担。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">一元淘吧上的电子产品及配件因为生成工艺或仓储物流原因，可能会存在收到或使用过程中出现故障的几率，一元淘吧不能保证所有的商品都没有故障，但我们保证所售商品都是全新正品行货，能够提供正规的售后保障。我们保证商品的正规进货渠道和质量，如果您对收到的商品质量表示怀疑，请提供生产厂家或官方出具的书面鉴定，我们会按照国家法律规定予以处理。但对于任何欺诈性行为，一元淘吧将保留依法追究法律责任的权利。本规则最终解释权由一元淘吧所有。</span></p><p><br/></p>', 63, 0, 1375862702, NULL),
(6, '3', '一元淘吧', '安全支付', '', '', 'a:0:{}', '', '', '<p>	</p><p><span style="color: rgb(102, 102, 102); font-family: 微软雅黑, Arial; font-size: 14px; line-height: 30px; text-indent: 28px; widows: 1; background-color: rgb(255, 255, 255);">一元淘吧作为平安银行、网银在线、支付宝、腾讯财付通、银联在线支付的认证商家，严格遵循网络购物的安全准则，通过网银在线、支付宝、财付通、银联在线支付等安全度高的支付方式，充分保证您在线支付的安全性。</span><span style="font-size: 16px; color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; line-height: 30px; text-indent: 28px;"></span></p>', 45, 0, 1375862712, NULL),
(7, '4', '一元淘吧', '商品配送', '', '', 'a:0:{}', '商品，快递，邮政EMS，一元淘吧', '', '<p>	</p><p class="textindent" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; text-indent: 2em; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">在您获得商品后，一元淘吧将在第一时间内免费为你寄出，一般采用签约快递，均为服务好，覆盖网点非常广泛的全国性快递公司或者邮政的EMS，以最大限度保证商品安全。如快递公司无法达到的地方，则使用邮政EMS为您寄送商品。</p><p class="textindent" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; text-indent: 2em; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">若遇商品暂时缺货或者是有其他方面的问题，一元淘吧客服将会及时与您沟通处理。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><br style="margin: 0px; padding: 0px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><br style="margin: 0px; padding: 0px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">配送费用</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; color: rgb(127, 127, 127);">所有商品全国免费配送。（港澳地区除外）</span></p>', 56, 0, 1375862725, NULL),
(8, '4', '一元淘吧', '配送费用', '', '', 'a:0:{}', '配送', '', '<p>	</p>\n<p><span style="color: rgb(102, 102, 102); font-size: 14px; line-height: 30px;"><font face="微软雅黑, sans-serif">一元淘吧的</font></span><span style="color: rgb(102, 102, 102); font-family: 微软雅黑, &#39;Microsoft YaHei&#39;; font-size: 14px; line-height: 30px;">所有商品全国免费配送。（港澳地区除外）</span></p>\n', 30, 0, 1375862737, NULL),
(9, '4', '一元淘吧', '验货签收', '', '', 'a:0:{}', '', '', '<p>	</p><p><br/></p><p class="bottom-space16px" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">1、您在签收商品时请慎重，请尽量不要让人代签，并务必先仔细检查商品（外包装是否被开封、商品是否破损、配件是否缺失、功能是否正常），确保无误后再签收，以免产生不必要的纠纷。若有任何疑问，请及时拨打客服电话反馈信息。若因用户未仔细检查商品即签收后产生的纠纷，一元淘吧概不负责，仅承担协调处理的义务。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; height: 10px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; font-family: 微软雅黑;"/></p><p class="bottom-space16px" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">2、若因您的地址填写错误、联系方式填写有误等情况造成商品无法完成投递或被退回，所产生的额外费用及后果由用户负责。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; height: 10px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; font-family: 微软雅黑;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">3、如因不可抗拒的自然原因（地震、洪水等等）所造成的商品配送延迟，一元淘吧不承担责任。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; height: 10px; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; font-family: 微软雅黑;"/></p><h4 style="margin: 30px 0px 0px; padding: 0px; font-family: 微软雅黑, Arial; font-size: 14px; color: rgb(102, 102, 102); line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">温馨提醒</h4><p class="textindent" style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; text-indent: 2em; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">若您或您的委托人已签收，则说明订单商品正确无误且不存在影响使用的因素，一元淘吧有权不受理因包装或商品破损、商品错漏发、商品表面质量问题、商品附带品及赠品少发为由的换货申请。</p>', 74, 0, 1375862747, NULL),
(10, '4', '一元淘吧', '已发货未收到', '', '', 'a:0:{}', '', '', '<p>	</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">长时间未收到商品可能出现的问题：</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">1、请您确保您的收货地址、邮编、电话、Email地址等各项信息的准确性，以便商品及时、准确地发出。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; font-family: 微软雅黑, Arial; color: rgb(102, 102, 102); font-size: 14px; line-height: 30px; white-space: normal; widows: 1; background-color: rgb(255, 255, 255);">2、当您的商品送达目的地之后，如快递人员在快件保管期（一般3-7天）未能联系到您，快件将退回，我们会联系您进行二次配送，由此产生的费用将由您自行承担。</p><p><br/></p>', 98, 0, 1375862760, NULL),
(13, '2', '一元淘吧', '联系我们', '', '', 'a:0:{}', '', '', '<p>	</p><p><br/></p><h3 class="mat0" style="margin: 0px; padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; white-space: normal; widows: 1;"><strong><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">联系我们</span></strong></h3>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">Q Q：906656566</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">邮 箱：1ytb@1ytb.cc</span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;"><span style="margin: 0px; padding: 0px;">网 址：<a title="" href="http://www.1ytb.cc/" target="_self" textvalue="http://www.mowosq.com/">http://www.1ytb.cc</a></span></span></p>\n<p style="padding: 0px; color: rgb(102, 102, 102); line-height: 30px; font-family: Tahoma, Arial, 宋体, Helvetica, sans-serif; font-size: 14px; margin-top: 0px; margin-bottom: 0px; white-space: normal; widows: 1;"><span style="margin: 0px; padding: 0px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;"><br style="margin: 0px; padding: 0px; font-family: 微软雅黑;"/></span></p><h3 style="margin: 30px 0px 0px; padding: 0px; color: rgb(102, 102, 102); line-height: 30px; fon