(14, '16', '一元淘吧', '淘吧公益', '', '', 'a:0:{}', '', '', '<p>	</p><p><br/>一、淘吧基金是一元淘吧创始人发起成立的以公益事业为主要方向的爱心基金。淘吧基金本着“我为人人，人人为我”的社会责任，向需要帮助的困难人们提供爱心捐助。<br/><br/>二、每位在一元淘吧进行分享购物的朋友，您的每次参与都将是为我们的公益事业做出一份贡献。当您每参与1人次1元淘，将由一元淘吧出资为淘吧基金筹款0.01元，所筹款项将全部用于淘吧基金。<br/><br/>三、淘吧基金将会以第1种途径或第2种途径进行使用：<br/>1、一元淘吧全体员工将组织向身边的公益事业进行捐赠与关怀活动。活动内容包括：资金、所需用品以及探望与协助等，每次捐赠与关怀活动结束后淘吧基金将公布活动详情以及基金详细使用报告。<br/>2、淘吧基金通过腾讯公益或壹基金等公益组织进行爱心捐赠。<br/><br/>四、包括淘吧基金的捐赠活动，我们不定期开展内部全体员工对身边更多公益事业或实时公益事业进行爱心捐赠的社会活动。<br/>&nbsp; <br/>&nbsp;&nbsp;&nbsp; 我们还将不定期邀请幸运者参与并见证我们的基金社会活动，共同为我们的社会责任付出一份爱心与力量。当活动启动前我们会将活动进行公告，您可自愿或自行组织参与，组成1元淘大家庭，共同开启活动之行。凡参与社会活动的幸运者均能获得一元淘吧为您精心准备的公益爱心礼品一份。<br/><br/><br/></p>', 63, 1, 1414361199, NULL);
